import React from "react";

const DIsplayItem = ({ ticket }) => {
  const getdigits = (num) => {
    let li = [];
    let temp = num;
    while (temp > 0) {
      li = [temp % 10, ...li];
      temp = Math.floor(temp / 10);
    }
  };
  let numList = [];
  numList = getdigits(ticket);

  return (
    <div className="digitFlex">
      {numList.map((digit) => {
        return <p>{digit}</p>;
      })}
    </div>
  );
};
export default DIsplayItem;
